import * as React from "react";
import {
  View,
  Text,
  Image,
  StyleSheet,
  Dimensions,
  ImageBackground,
} from "react-native";
import { Provider as PaperProvider, Button } from "react-native-paper";
import Icon from "react-native-vector-icons/Ionicons";
// import {Restart} from 'fiction-expo-restart';

export default function HomeScreen({ navigation }) {
  // Parsa's Page
  return (
    <View style={styles.container}>
      <ImageBackground
        blurRadius={10}
        style={{ width: win.width, height: 1140 / 5 }}
        source={{
          uri: "https://alliancedefensivedrivingschool.com/wp-content/uploads/elementor/thumbs/Untitled-design-9-oym58s0pye8x2951fo0w9ynuifc1l3lefssdtuqglk.png",
        }}
      >
        <View style={{ padding: 10 }}>
          <View
            style={{
              width: "25%",
              height: "55%",
              borderRadius: 15,
              overflow: "visible",
            }}
          >
            <Image
            style={{
              width: 100,
              height: 100,
              resizeMode: "contain",
              borderRadius: 150/2,
              overflow: "hidden",
            }}
            source={{ uri: "https://i.pravatar.cc/150?img=59" }}
          ></Image>
          </View>
          <Text style={{ color: "white", padding: 10, fontFamily: "Futura" }}>
            James Peterson
          </Text>
          <Text style={{ color: "white", padding: 10, fontFamily: "Futura" }}>
            jpeterson@drivequest.com
          </Text>
        </View>
      </ImageBackground>
      <PaperProvider>
        <View
          style={{
            padding: 70,
            flexDirection: "column",
            justifyContent: "space-between",
          }}
        >
          <Button
            mode="contained"
            onPress={() => alert("TEST")}
            style={{
              alignItems: "center",
              justifyContent: "space-between",
              marginBottom: 20,
            }}
          >
            Pre-Drive
          </Button>
          <Button mode="contained" style={{ marginBottom: 20, marginTop: 20, color: "#00677F" }}>
            Parking Lot
          </Button>
          <Button mode="contained" style={{ marginBottom: 20, marginTop: 20, color: "#00677F"  }}>
            Residential
          </Button>
          <Button mode="contained" style={{ marginBottom: 20, marginTop: 20, color: "#00677F"  }}>
            Freeway
          </Button>
          <Button mode="contained" style={{ marginBottom: 20, marginTop: 20, color: "#00677F"  }}>
            Test result
          </Button>
          <Icon name="md-warning" style={styles.icon}></Icon>
        </View>

        {/* <Image source={{ uri: "https://picsum.photos/200/300" }} style={{ width: 200, height: 300 }} onPress={() => Restart()}/> */}
      </PaperProvider>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  icon: {
    position: "relative",
    color: "rgba(205,50,50,1)",
    fontSize: 98,
    width: 86,
    height: 107,
    marginLeft: 22,
  },
});

const win = Dimensions.get("window");
const ratio = win.width / 500;
